import React from 'react';
import Data from './Data';
import Box from './Box';

const Service = () => {
  return(
    <>
      {Data.map((val,key)=>{
        return <Box name ={val.name} imgsrc={val.photo}/>
      })}
    </>
  )
}

export default Service;
